import React from "react";
import {NavLink} from 'react-router-dom';
const Menu = () => {
  return (
    <>
    <div></div>
      <NavLink exact activeClassName="active_class" to="/">
        AboutUS
      </NavLink>
      <NavLink exact activeClassName="active_class" to="/">
        Services
      </NavLink>
      <NavLink exact activeClassName="active_class" to="/Contact">
        Contact
      </NavLink>
    </>
  );
};

export default Menu;
